uniform float iTime;
uniform vec2 iResolution;

// 12 Connected Parameters - No logic changes, just exposure
uniform float u_speed;          // Default: 0.2
uniform float u_scale;          // Default: 1.0
uniform float u_intensity;      // Default: 1.5
uniform float u_color_cycle;    // Default: 0.2
uniform float u_layers;         // Default: 4.0
uniform float u_line_fatness;   // Default: 12.0 (Lower = Fatter Line)
uniform float u_halo_width;     // Default: 3.0 (Lower = Wider Halo)
uniform float u_dust_grid;      // Default: 80.0
uniform float u_dust_twinkle;   // Default: 3.0
uniform float u_dust_drift;     // Default: 0.2
uniform float u_hue_rotate;     // Default: 0.5
uniform float u_vignette;       // Default: 0.4

out vec4 fragColor;

mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

float hash(vec2 p) {
    p = fract(p * vec2(123.34, 456.21));
    p += dot(p, p + 45.32);
    return fract(p.x * p.y);
}

vec3 palette(float t) {
    vec3 a = vec3(0.5, 0.5, 0.5);
    vec3 b = vec3(0.5, 0.5, 0.5);
    vec3 c = vec3(1.0, 1.0, 1.0);
    vec3 d = vec3(u_hue_rotate, 0.20, 0.25);
    return a + b * cos(6.28318 * (c * t + d));
}

float getDust(vec2 uv, float t) {
    float gridSize = u_dust_grid; 
    vec2 id = floor(uv * gridSize);
    vec2 f = fract(uv * gridSize);
    float r = hash(id);
    vec2 pos = vec2(r, fract(r * 22.34));
    float d = distance(f, pos);
    float size = 0.25 * (0.5 + 0.5 * sin(t * u_dust_twinkle + r * 10.0));
    float spark = smoothstep(size, size * 0.1, d);
    return spark * r; 
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.1 * iResolution.xy) / iResolution.y;
    vec2 uv0 = uv;

    float spd = (u_speed <= 0.0) ? 0.2 : u_speed;
    float t = iTime * spd;

    // --- Background ---
    vec3 bgTop = vec3(0.25, 0.0, 0.35); 
    vec3 bgBottom = vec3(0.05, 0.02, 0.15); 
    bgTop += 0.02 * sin(t * 0.3);
    vec3 finalColor = mix(bgBottom, bgTop, uv0.y + 0.5 + 0.1 * sin(t * 0.2));

    // --- Layer Loop ---
    float density = (u_layers <= 0.0) ? 4.0 : u_layers;
    float scale = (u_scale <= 0.0) ? 1.0 : u_scale;
    float brightness = (u_intensity <= 0.0) ? 1.5 : u_intensity;

    for(float i = 0.0; i < 6.0; i++) {
        if(i >= density) break;

        vec2 lineUV = uv0 * (1.0 + scale * 0.5);
        lineUV *= rot(t * 0.1 + i * 0.8);

        float movement = sin(lineUV.y * 2.0 + t + i) * 0.5;
        movement += cos(lineUV.x * 1.0 - t + i * 1.5) * 0.5;

        float dist = abs(lineUV.x + movement);

        // --- Main Line Glow (Parameters Applied Here) ---
        float coreGlow = exp(-dist * u_line_fatness); 
        float softGlow = exp(-dist * u_halo_width) * 0.4; 

        // --- Fine Sprinkle Dust Logic ---
        vec2 dustUV = lineUV;
        dustUV.x += movement * 0.7; 
        dustUV.x -= t * u_dust_drift; 
        dustUV.y += t * 0.05; 

        float specks = getDust(dustUV + vec2(i*10.0, i*5.0), t);
        float sprayMask = exp(-dist * 2.0); 
        float dust = specks * sprayMask * 2.0;

        // --- Coloring ---
        vec3 col = palette(length(uv0) * 0.5 + i * 0.3 + t * u_color_cycle);
        vec3 dustCol = mix(col, vec3(1.0, 0.95, 0.8), 0.7);

        finalColor += col * (coreGlow + softGlow) * brightness * 0.4;
        finalColor += dustCol * dust * brightness;
    }

    // --- Post-Processing ---
    float vig = 1.0 - length(uv0) * u_vignette;
    finalColor *= vig;
    finalColor = smoothstep(-0.05, 1.4, finalColor);

    fragColor = vec4(finalColor, 1.0);
}

